import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Box, Button, TextField, Typography, Paper } from '@mui/material';

const templates = {
  1: { name: '', email: '', phone: '', address: '', education: 'Bachelor in CS', experience: '', skills: 'JavaScript, React' },
  2: { name: '', email: '', phone: '', address: '', education: 'MBA', experience: '', skills: 'Management, Marketing' },
  3: { name: '', email: '', phone: '', address: '', education: 'Fine Arts Degree', experience: '', skills: 'Photoshop, Illustrator' },
};

const ResumeBuilder = () => {
  const { templateId } = useParams();
  const [formData, setFormData] = useState(templates[templateId] || {});

  useEffect(() => {
    if (templateId && templates[templateId]) {
      setFormData(templates[templateId]);
    }
  }, [templateId]);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Resume Saved!');
  };

  return (
    <Box sx={{ padding: 4, minHeight: '100vh' }}>
      <Typography variant="h4" align="center" gutterBottom>
        Edit Your Resume
      </Typography>
      <Paper sx={{ padding: 4, maxWidth: 600, margin: 'auto' }}>
        <form onSubmit={handleSubmit}>
          <TextField
            fullWidth
            label="Name"
            name="name"
            value={formData.name}
            onChange={handleChange}
            margin="normal"
          />
          {/* Add other fields like Email, Phone, etc. */}
          <Button type="submit" variant="contained" color="primary" fullWidth>
            Save Resume
          </Button>
        </form>
      </Paper>
    </Box>
  );
};

export default ResumeBuilder;
